import {useState,useEffect} from 'react';
import Products from './Products';
function Mid3() {
    const [students, setStudent]= useState([]);
    useEffect(()=>{
        fetch('api/')
        .then((res)=>{return res.json()})
        .then((students)=>{
            setStudent(students)
            //console.log(students);
        })
    },[])
    return ( 
        <div>
             {students.map((result)=>(
                 
                     <Products name={result.name}
                     disc={result.disc}
                     price={result.price}/>
             ))}
        </div>
     );
}

export default Mid3;
